import React from "react";
import propTypes from "prop-types";

import * as Styled from "./style";

const Th = ({ children, width }) => {
  return <Styled.Th width={width}>{children}</Styled.Th>;
};

Th.prototype = {
  children: propTypes.node.isRequired,
};

export default Th;
